import React, { useEffect } from 'react';
import {
  createBrowserRouter,
  RouterProvider,
  Navigate,
  useNavigate,
  Outlet
} from 'react-router-dom';
import { AuthProvider, useAuth } from './contexts/AuthContext';
import { DarkModeProvider } from './contexts/DarkModeContext';
import ProtectedRoute from './components/auth/ProtectedRoute';

// Layout components
import MainLayout from './components/layouts/MainLayout';
import AdminLayout from './components/layouts/AdminLayout';

// Auth pages
import Login from './pages/auth/Login';
import Register from './pages/auth/Register';
import ForgotPassword from './pages/auth/ForgotPassword';

// Dashboard pages
import Dashboard from './pages/Dashboard';

// Admin pages
import AdminDashboard from './pages/admin/AdminDashboard';
import UsersManagement from './pages/admin/UsersManagement';
import LlmIntegration from './pages/admin/LlmIntegration';
import SystemSettings from './pages/admin/SystemSettings';
import AnalyticsDashboard from './pages/admin/AnalyticsDashboard';

// Client management
import ClientsList from './pages/clients/ClientsList';
import ClientDetails from './pages/clients/ClientDetails';
import NewClient from './pages/clients/NewClient';

// Case management
import CasesList from './pages/cases/CasesList';
import CaseDetails from './pages/cases/CaseDetails';
import NewCase from './pages/cases/NewCase';

// Legal pages
import TermsOfService from './pages/legal/TermsOfService';
import PrivacyPolicy from './pages/legal/PrivacyPolicy';

// Document management
import DocumentsList from './pages/documents/DocumentsList';
import DocumentDetails from './pages/documents/DocumentDetails';
import UploadDocument from './pages/documents/UploadDocument';

// Calendar page
import Calendar from './pages/Calendar';

// Global auth check wrapper
const AuthCheck = () => {
  const { isAuthenticated, checkAuthStatus } = useAuth();
  const navigate = useNavigate();

  useEffect(() => {
    const verifyAuth = async () => {
      if (!isAuthenticated) {
        // Try to validate token, redirect to login if it fails
        await checkAuthStatus(true);
      }
    };

    verifyAuth();
  }, [isAuthenticated, checkAuthStatus, navigate]);

  return <Outlet />;
};

// Create router with auth provider
const AppWithRouter = () => {
  const router = createBrowserRouter([
    // Public routes that don't require authentication
    {
      path: "/login",
      element: <Login />
    },
    {
      path: "/register",
      element: <Register />
    },
    {
      path: "/forgot-password",
      element: <ForgotPassword />
    },
    {
      path: "/terms",
      element: <TermsOfService />
    },
    {
      path: "/privacy",
      element: <PrivacyPolicy />
    },

    // Protected routes
    {
      element: <AuthCheck />,
      children: [
        // Main application routes (protected)
        {
          path: "/",
          element: <ProtectedRoute><MainLayout /></ProtectedRoute>,
          children: [
            { index: true, element: <Dashboard /> },
            { path: "clients", element: <ClientsList /> },
            { path: "clients/new", element: <NewClient /> },
            { path: "clients/:id", element: <ClientDetails /> },
            { path: "cases", element: <CasesList /> },
            { path: "cases/new", element: <NewCase /> },
            { path: "cases/:id", element: <CaseDetails /> },
            { path: "documents", element: <DocumentsList /> },
            { path: "documents/upload", element: <UploadDocument /> },
            { path: "documents/:id", element: <DocumentDetails /> },
            { path: "calendar", element: <Calendar /> },
          ],
        },

        // Admin routes (protected and admin only)
        {
          path: "/admin",
          element: <ProtectedRoute adminOnly={true}><AdminLayout /></ProtectedRoute>,
          children: [
            { index: true, element: <AdminDashboard /> },
            { path: "users", element: <UsersManagement /> },
            { path: "llm-integration", element: <LlmIntegration /> },
            { path: "settings", element: <SystemSettings /> },
            { path: "analytics", element: <AnalyticsDashboard /> },
          ],
        },
      ]
    },

    // Fallback route - Navigate to dashboard if logged in, otherwise to login
    { 
      path: "*", 
      element: <Navigate to="/login" replace /> 
    }
  ], {
    future: {
      v7_startTransition: true,
      v7_relativeSplatPath: true,
    },
  });

  return (
    <RouterProvider router={router} />
  );
};

function App() {
  return (
    <DarkModeProvider>
      <AuthProvider>
        <AppWithRouter />
      </AuthProvider>
    </DarkModeProvider>
  );
}

export default App;
